const SNAPSHOT_PLACEHOLDER =
  "data:image/jpeg;base64,"
const SNAPSHOT_SELECTOR = "img[data-snapshot-src]"

function resolveSnapshotConcurrency(): number {
  const target = document.querySelector<HTMLElement>("[data-snapshot-concurrency]")
  if (!target) return 1
  const raw = target.dataset.snapshotConcurrency ?? ""
  const parsed = Number.parseInt(raw, 10)
  return Number.isFinite(parsed) && parsed > 0 ? parsed : 1
}

function ensurePlaceholder(img: HTMLImageElement) {
  if (!img.dataset.snapshotPlaceholder) {
    img.dataset.snapshotPlaceholder = PLACEHOLDER_FALLBACK
  }
  const current = img.getAttribute("src")
  const placeholder = img.dataset.snapshotPlaceholder
  if (!current || current === img.dataset.snapshotSrc || current === "") {
    img.src = placeholder ?? PLACEHOLDER_FALLBACK
  }
}

document.addEventListener("nav", () => {
  const concurrency = resolveSnapshotConcurrency()
  const queue: HTMLImageElement[] = []
  const inflight = new Set<HTMLImageElement>()

  const launchNext = () => {
    while (inflight.size < concurrency && queue.length > 0) {
      const candidate = queue.shift()
      if (!candidate) continue
      if (!document.contains(candidate)) {
        continue
      }
      if (candidate.dataset.snapshotLoaded === "true") {
        continue
      }

      const source = candidate.dataset.snapshotSrc
      if (!source) {
        candidate.dataset.snapshotLoaded = "true"
        continue
      }

      const finalize = (success: boolean) => {
        inflight.delete(candidate)
        candidate.dataset.snapshotLoading = ""
        candidate.dataset.snapshotQueued = ""
        if (success) {
          candidate.dataset.snapshotLoaded = "true"
          delete candidate.dataset.snapshotError
        } else {
          candidate.dataset.snapshotError = "true"
        }
        launchNext()
      }

      const onLoad = () => {
        candidate.removeEventListener("error", onError)
        finalize(true)
      }

      const onError = () => {
        candidate.removeEventListener("load", onLoad)
        finalize(false)
      }

      candidate.dataset.snapshotLoading = "true"
      inflight.add(candidate)
      candidate.addEventListener("load", onLoad, { once: true })
      candidate.addEventListener("error", onError, { once: true })
      candidate.src = source
    }
  }

  const enqueue = (img: HTMLImageElement, prioritize = false) => {
    if (img.dataset.snapshotQueued === "true") return
    img.dataset.snapshotQueued = "true"
    if (prioritize) queue.unshift(img)
    else queue.push(img)
    launchNext()
  }

  const intersection = new IntersectionObserver(
    (entries) => {
      for (const entry of entries) {
        if (!entry.isIntersecting) continue
        const img = entry.target as HTMLImageElement
        intersection.unobserve(img)
        enqueue(img)
      }
    },
    { rootMargin: "192px 0px" },
  )

  const register = (img: HTMLImageElement) => {
    if (!img.dataset.snapshotSrc) return
    if (img.dataset.snapshotRegistered === "true") return
    img.dataset.snapshotRegistered = "true"
    ensurePlaceholder(img)
    img.loading = "lazy"
    img.decoding = "async"
    if (img.hasAttribute("data-snapshot-eager")) {
      enqueue(img, true)
    } else {
      intersection.observe(img)
    }
  }

  document.querySelectorAll<HTMLImageElement>(SNAPSHOT_SELECTOR).forEach(register)

  const mutation = new MutationObserver((mutations) => {
    for (const mutationRecord of mutations) {
      for (const node of mutationRecord.addedNodes) {
        if (node instanceof HTMLImageElement) {
          register(node)
        } else if (node instanceof HTMLElement) {
          node.querySelectorAll<HTMLImageElement>(SNAPSHOT_SELECTOR).forEach(register)
        }
      }
    }
  })

  mutation.observe(document.body, { childList: true, subtree: true })

  window.addCleanup(() => {
    intersection.disconnect()
    mutation.disconnect()
    queue.length = 0
    inflight.clear()
  })
})
